import React from "react";

import Title from "../../shared/components/Title";
import Summary from "../components/Summary";
import Button from "../../shared/components/Button";
import Image from "../../shared/components/Image";
import Container from "../../shared/components/Container";
import myPhoto from "../../images/My_photo_copy.PNG";

const HomePage = () => {
    return (
        <Container className="container centered-container">
            <Container className="row">
                <Container className="col-lg-6 col-sm-12 " >
                    <Image className="my-photo" src={myPhoto} alt="Denis Ladychenko"/>
                </Container>
                <Container className="col col-lg-6 col-sm-12">
                    <Title  className="title"/>
                    <Summary  className="summary"/>
                    <Button  className="btn btn-primary btn-lg btn-block home-page-button"/>
                </Container>
            </Container>
        </Container>
    );
};

export default HomePage;
